import React from 'react'

const ClickyButton = (props) => {
    const { buttonClicks, setButtonClicks } = props
    return (
        [<button onClick={() => setButtonClicks(buttonClicks+1)}>
        click me
        </button>,]
    )
}

export default ClickyButton
